c9 importante lembrar que os modelos ARX s\u00e3o mais adequados para predi\u00e7\u00f5es de curta dura\u00e7\u00e3o, e, quanto maior for o horizonte de predi\u00e7\u00e3o, maior ser\u00e1 o erro associado. Outro fator importante a ser considerado aqui \u00e9 que todos os modelos apresentados foram obtidos automaticamente. Isto \u00e9, existe um algoritmo que captura os dados do minist\u00e9rio da sa\u00fade e de mobilidade, e realiza as predi\u00e7\u00f5es de forma autom\u00e1tica, sem a interven\u00e7\u00e3o humana. Isto significa que, devido a particularidades dos estados quanto a coleta de informa\u00e7\u00f5es e outros fatores, as predi\u00e7\u00f5es podem n\u00e3o representar corretamente a evolu\u00e7\u00e3o das vari\u00e1veis. Por isso, essas informa\u00e7\u00f5es devem ser analisadas com cuidado e de forma cr\u00edtica."},"id":"105855","type":"Paragraph"},{"attributes":{"line_alpha":0.1,"line_color":"#b2df8a","line_width":2.0,"x":{"field":"x"},"y":{"field":"y"}},"id":"104692","type":"Line"},{"attributes":{"data_source":{"id":"103219"},"glyph":{"id":"103220"},"hover_glyph":null,"muted_glyph":null,"name":" Minas Gerais","nonselection_glyph":{"id":"103221"},"selection_glyph":null,"view":{"id":"103223"}},"id":"103222","type":"GlyphRenderer"},{"attributes":{"axis":{"id":"102893"},"ticker":null},"id":"102896","type":"Grid"},{"attributes":{"data":{"x":{"__ndarray__":"AABARNIKd0IAAACqJAt3QgAAwA93C3dC","dtype":"float64","shape":[3]},"y":[100.0,50.0,0.0,500.0,83.33333333333334,50.0,0.0,600.0,28.57142857142857,233.33333333333334,25.0,400.0,153.84615384615387,209.52380952380955,22.22222222222222,609.0909090909091,69.11764705882352,150.0,89.04109589041096,77.27272727272727,138.46153846153845,89.04109589041096,63.63636363636363,132.5581395348837,87.93103448275862,238.46153846153845,128.0,50.931677018633536,207.2289156626506,85.54913294797689,44.966442953020135,333.8235294117647,109.64912280701755,110.75697211155378,88.88888888888889,57.42971887550201,172.22222222222223,1
